import './App.css';

function App() {
    return (
        <div className="App">
            <div className="information">
                <label>Name:</label>
                <input type="text"/>
                <label>Age:</label>
                <input type="Number"/>
                <label>Country:</label>
                <input type="text"/>
                <label>Position:</label>
                <input type="text"/>
                <label>Wage (per year):</label>
                <input type="number"/>
                <button>Add employee</button>
            </div>
        </div>
    );
}

export default App;
